import './SubmitBtn.css'

function SubmitBtn(props){
  return (
    <button
      type="button"
      className={props.disable ? "SubmitBtn" : "NSubmitBtn"}
      onClick={props.onClick}
      disabled={props.disable ? "disabled" : ""}
    >
    <span className="text">{props.text}</span>
    </button>
  )
}

export default SubmitBtn;
